import React from "react";
import "./Inventory.css";

const Inventory = () => {
  const inventoryData = {
    Fruits: [
      { name: "Banana", quantity: "5 Bunches" },
      { name: "Apple", quantity: "10" },
      { name: "Guava", quantity: "10" },
    ],
    Dairy: [
      { name: "Milk", quantity: "5 packs" },
      { name: "Cheese", quantity: "3 packs" },
      { name: "Curd", quantity: "2 packs" },
    ],
    Vegetables: [
      { name: "Onion", quantity: "3kg" },
      { name: "Cabbage", quantity: "3kg" },
    ],
    Others: [
      { name: "Chips", quantity: "3 packs" },
      { name: "Oil", quantity: "3 packs" },
    ],
  };

  const renderCategory = (categoryName, items, colorClass) => (
    <div className="inventory-category">
      <div className="category-header">
        <span className={`dot ${colorClass}`}></span>
        <h3>{categoryName}</h3>
      </div>
      <ul className="category-list">
        {items.map((item, index) => (
          <li key={index}>
            {item.name} ---&gt; {item.quantity}
          </li>
        ))}
      </ul>
    </div>
  );

  return (
    <div className="inventory-container">
      <div className="inventory-header">
        <h1>INVENTORY</h1>
      </div>
      <div className="inventory-content">
        {renderCategory("Fruits", inventoryData.Fruits, "fruits")}
        {renderCategory("Dairy", inventoryData.Dairy, "dairy")}
        {renderCategory("Vegetables", inventoryData.Vegetables, "vegetables")}
        {renderCategory("Others", inventoryData.Others, "others")}
      </div>
    </div>
  );
};

export default Inventory;
